rawText:
 (
  tsModel:
    | TsFunction
    | TsComment
    | TsInterface
    | TsBuildError
    | TsLintWarning
    | TsExport
    | TsImport
    | TsVariable,
  operationName: string,
  operationRelativePaths: string[]
) => {
  if (!tsModel.operationName) return true;
  if (tsModel.operationName !== operationName) return true;
  if (!tsModel.operationRelativePath) return true;
  if (
    !operationRelativePaths.includes(
      tsModel.operationRelativeTypescriptFilePath
    )
  ) {
    return true;
  }
  return false;
}
